export default function Lista(props){
    return(<div>
        <ul>
            {props.productos.map((item, index) => {
                return(
                    <li className="tarjeta" key={index}>
                        <img src={item.images[0]} onClick={console.log(item.id)}></img>
                        <p>{item.title}</p>
                    </li>
                )
            })}
        </ul>
    </div>
    )
}
